                   <Header/> 
                </div>
                <div className="dimeBodyTwo">
                    <img src={``} alt="dimelogo"/>
                    <h1>Check your inbox</h1>
                    <h2>We&#39;ve sent you an email containing instructions for resetting your password.</h2>
                    <button>Need more help? Contact Us</button>
                </div>
            </div>
        )
    }
}
